package alg.zhj.mindcollections.campaign.week02.preview;

import java.util.HashMap;
import java.util.Map;

/**
 * Created by zhaohongjie on 2020/6/14.
 */
public class IsAnagram_242 {

    public boolean isAnagram(String s, String t) {

        if (s == null || t == null) {
            return false;
        }

        if (s.length() != t.length()) {
            return false;
        }

        Map<Character, Integer> indexS = new HashMap<>();
        for (char c : s.toCharArray()) {
            if (indexS.containsKey(c)) {
                indexS.put(c, indexS.get(c) + 1);
            } else {
                indexS.put(c, 1);
            }
        }

        Map<Character, Integer> indexT = new HashMap<>();
        for (char c : t.toCharArray()) {
            if (indexT.containsKey(c)) {
                indexT.put(c, indexT.get(c) + 1);
            } else {
                indexT.put(c, 1);
            }
        }

        for (char c : indexS.keySet()) {
            if (!indexS.get(c).equals(indexT.get(c))) {
                return false;
            }
        }

        return true;
    }

    public static void main(String[] args) {
        String str1 = "";
        String str2 = "";

        IsAnagram_242 obj = new IsAnagram_242();
        System.out.print(obj.isAnagram(str1, str2));
    }
}
